import React, { useState } from "react";
import FormUser from "./FormUser";
import "./FormAppend.css";

const FormAppend = (props) => {
  let content = (
    <p style={{ textAlign: "center", fontWeight: "bold" }}>Add A User</p>
  );

  if (props.user_array.le > 0) {
    content = <FormUser items={props.user_array} userData={props.user_data} />;
  }

  return (
    <div className="display-user">
      {content}
      {/* <FormUser userData={props.user_data} /> */}
    </div>
  );
};

export default FormAppend;
